import React, { Component } from "react";
import {
  HashRouter,
  Routes,
  Route,
  NavLink
} from "react-router-dom";
import Home from "./Home";
import Stuff from "./Stuff";
import Contact from "./Contact";
 
class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div>
          <h1 className="text-white">Simple SPA</h1>
          <ul className="header">
            <div className="row">
              <div className="row"></div>
            </div>
            <li className="col-4 p-0 m-0"><NavLink className="p-0 py-2" to="/">Home</NavLink></li>
            <li className="col-4 p-0 m-0"><NavLink className="p-0 py-2" to="/stuff">Stuff</NavLink></li>
            <li className="col-4 p-0 m-0"><NavLink className="p-0 py-2" to="/contact">Contact</NavLink></li>
          </ul>
          <div className="content">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="stuff" element={<Stuff />} />
              <Route path="contact" element={<Contact />} />
            </Routes>
          </div>
        </div>
      </HashRouter>
    );
  }
}
 
export default Main;
